INSERT INTO c_claveunidad VALUES(null,'AK','Braza','Una braza es una unidad de longitud náutica, usada generalmente para medir la profundidad del agua. Se llama braza porque equivale a la longitud de un par de brazos extendidos, aproximadamente dos metros, ó 6 pies en el sistema de medición estadounidense. Actualmente es considerada arcaica e imprecisa.','','2022-01-01','','fth','4.00',5,now());
