INSERT INTO c_claveunidad VALUES(null,'MIN','Minuto [unidad de tiempo]','Es una unidad de tiempo que equivale a la sexagésima parte de una hora. También comprende 60 segundos. Su símbolo es min (adviértase que no es una abreviatura: no admite mayúscula, ni punto, ni plural).','','2022-01-01','','min','4.00',5,now());
INSERT INTO c_claveunidad VALUES(null,'MIO','Millón','Es igual a mil millares, o 106. El concepto de millón también se puede expresar mediante el prefijo mega antepuesto a unidades del SI. Etimología: millón proviene del término italiano milione (del latín: mille).','','2022-01-01','','','4.00',5,now());
