DROP TABLE IF EXISTS `c_claveunidad`;
CREATE TABLE IF NOT EXISTS `c_claveunidad` (
  `id` int(2) UNSIGNED NOT NULL AUTO_INCREMENT,
  `id_cfdi` varchar(3) COLLATE utf8_spanish_ci NOT NULL,
  `nombre` varchar(150) COLLATE utf8_spanish_ci NOT NULL,
  `descripcion` text COLLATE utf8_spanish_ci DEFAULT NULL,
  `notas` varchar(250) COLLATE utf8_spanish_ci DEFAULT NULL,
  `vigencia_desde` date DEFAULT NULL,
  `vigencia_hasta` date DEFAULT NULL,
  `simbolo` varchar(30) DEFAULT NULL COLLATE utf8_spanish_ci,
  `version` decimal(4,2) DEFAULT NULL,
  `ultusuario` int(5) UNSIGNED DEFAULT NULL,
  `create_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci COMMENT='catálogo de claves de unidad SAT Mexico';

